import React from 'react'
import style from "../../styles/PopUpInvoice.module.css";
import { SuccessIcon } from './Arrows';

export const PopUpInvoice = () => {
  return (
    <div className={style.PopUpBg}>
      <div className={style.PopUpWrapper}>
        <div className={style.PopUpTextWrapper}>Ваше замовленння прийнято!</div>
        <div className={style.PopIconUpWrapper}><SuccessIcon/></div>
        <div className={style.PopButtonUpWrapper}></div>
      </div>
    </div>
  );
}
